import React from 'react';
import l1 from '../public/files/images/l1.jpg';
import l2 from '../public/files/images/l2.jpg';
import l3 from '../public/files/images/l3.jpg';

function Locations() {
    return (
        <section className="locations">
            <div className="location-heading">
                <h1>Discover The <span>Beautiful World</span></h1>
            </div>
            <div className="location-content">
                <div className="col-content">
                    <img src={l1} alt="Kashmir" />
                    <h5>India</h5>
                    <p>Kashmir</p>
                </div>
                <div className="col-content">
                    <img src={l2} alt="Istanbul" />
                    <h5>Turkey</h5>
                    <p>Istanbul</p>
                </div>
                <div className="col-content">
                    <img src={l3} alt="Paris" />
                    <h5>France</h5>
                    <p>Paris</p>
                </div>
            </div>
        </section>
    );
}

export default Locations;
